INSERT INTO `posts` (`id`, `type`, `permalink`, `title`, `body`, `show_menu`, `created_at`, `updated_at`) VALUES
(4, 'page', 'about',  'About',  '<h2>Sweedx is a crypto currency exchange platform</h2>\r\n\r\nMore information incoming...\r\n\r\n', NULL, '2014-04-02 01:17:59',  '2014-10-03 16:11:51'),
(8, 'page', 'security', 'Security', '<h3><strong>Offline Funds Storage</strong></h3>\r\n\r\n<p>We store the majority of our customer\'s funds in a secure offline wallet, with only a portion available in a \'hot\' wallet for instant withdrawals. This method vastly improves security at a minor expense of large withdrawals requiring manual processing.</p>\r\n\r\n<h3><strong>DDoS Protection & CDN Caching</strong></h3>\r\n\r\n<p>We utilize a leading DDoS provider for all public facing content and cache all static content on a CDN to provide the fastest possible load times.</p>\r\n\r\n<h3><strong>Logical & Physical Security</strong></h3>\r\n\r\n<p>All website components are logically separated and protected by physical firewalls for increased security. All employees are required to connect to a secure VPN before gaining access to any systems.</p>\r\n\r\n<h3><strong>Secure Website</strong></h3>\r\n\r\n<p>All interaction with the website is required over HTTPS so all communication is encrypted via SSL.</p>\r\n\r\n<h3><strong>Server Scanning</strong></h3>\r\n\r\n<p>We use an industry recognised PCI (credit card provisioning compliance) scanning service to routinely scan the website to aid in locating any potential security issues.</p>\r\n\r\n<h3><strong>Application Security</strong></h3>\r\n\r\n<p>We use industry standard methods for preventing SQL Injection & XSS attacks on our website. In additional, all passwords & sensitive data are encrypted along with a static & random salt.</p>\r\n',  NULL, '2014-04-02 02:09:10',  '2014-10-03 16:36:37'),
(9, 'page', 'terms',  'Terms',  'Sweedx is a trading website that allows users to trade bitcoins and other crypto currencies.\r\n<br /><br />\r\nBy viewing the Sweedx web site, you are agreeing that you are bound by the Terms and Conditions of Use, all applicable laws and regulations, you also agree that you are responsible for compliance with any applicable local laws. If you do not agree with any of these terms, you are prohibited from using or accessing this site and you must leave immediately. The materials provided in this web site are protected by applicable copyright and trade mark laws.\r\n <br /><br />\r\nThe material on Sweedx\'s web site is provided \"as is\". Which means it makes no warranties, expressed or otherwise, and hereby disclaims and negates all other warranties, including without limitation, implied warranties or conditions of merchantability, fitness for a particular purpose, or non-infringement of intellectual property or other violation of rights. Furthermore, Sweedx does not warrant or make any representations concerning the accuracy, likely results, or reliability of the use of the materials on its web site or otherwise relating to such materials or on any sites linked to this site.\r\n <br /><br />\r\nThe Sweedx website is restricted to adults only meaning all persons 18 years and over are allowed to use the site. If you are 17 years or younger you are not allow to use this website and must leave immediately.\r\n <br /><br />\r\nThere shall be no event where Sweedx be liable for any damages (including, without limitation, damages for loss of data or profit, or due to business interruption, monetary or intellectual) arising out of the use or inability to use Sweedx’s web site, even if Sweedx or a Sweedx authorized representative has been notified orally or in writing of the possibility of such damage. Because some jurisdictions do not allow limitations on implied warranties, or limitations of liability for consequential or incidental damages, these limitations may not apply to you.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<br /><br />\r\nTrading Crypto currencies carries a high degree of risk, and its possible you can lose all or some of your crypto currencies, as the price goes up and down.<br /><br />\r\n\r\n', 1,  '2014-04-02 02:09:39',  '2014-10-22 15:30:52'),
(11,  'news', 'beta-testing-of-realtime-trading-system',  'Beta testing of realtime trading system',  'Hello followers,<br />\r\nthis week, mainly between 13th - 16th of November we have a scheduled a beta test of the realtime trading system.<br />\r\n<br />\r\nAll kind of bugs/errors found can be reported to me at: freenode.<br />\r\njoin us #Sweedx<br />\r\nregards Anoxy', NULL, '2014-11-10 20:14:10',  '2014-11-10 20:21:05'),
